script: |
  super -f text -I q10505.spq | sort > q10505.out

inputs:
  - name: q10505.spq
    data: |
      SELECT ALL - col0 AS col2, col1 FROM tab1 (FORMAT parquet) WHERE 96 NOT BETWEEN col2 AND ( - - col1 );
  - name: tab1

outputs:
  - name: q10505.out
    data: |
      -51	14
      -85	5
      -91	47
